import styled from "styled-components";
import { Container } from "./Container";

const Wrapper = styled.main`
  padding: 0 0;

  @media (min-width: 767px) {
    padding: 4rem 0;
  }
`;

const Badges = styled.div``;

export const Main = ({ children }) => {
  return (
    <Wrapper>
      <Container>{children}</Container>
      <Badges></Badges>
    </Wrapper>
  );
};
